import React from "react";
import { Background, Image, DownloadButton, Column } from "./style";
import logo from "../../assets/images/logo.svg";

function Home() {
  return (
    <Background>
      <Column></Column>
      <Column>
        <Image src={logo} height="25vh"></Image>
        <DownloadButton style={{marginBottom: "10vh"}}>Download</DownloadButton>
      </Column>
      <Column></Column>
    </Background>
  );
}

export default Home;
